function exportarDados() {
  const dados = {
    despesas: JSON.parse(localStorage.getItem("despesas") || "[]"),
    salarios: JSON.parse(localStorage.getItem("salarios") || "[]"),
    metas: JSON.parse(localStorage.getItem("metas") || "[]"),
    ganhos: JSON.parse(localStorage.getItem("ganhosExtras") || "[]")
  };

  const blob = new Blob([JSON.stringify(dados, null, 2)], { type: "application/json" });
  const link = document.createElement("a");
  link.href = URL.createObjectURL(blob);
  link.download = "controle-financeiro-dados.json";
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
}

function resetarDados() {
  if (confirm("Tem certeza que deseja apagar TODOS os dados? Essa ação não pode ser desfeita.")) {
    localStorage.removeItem("despesas");
    localStorage.removeItem("salarios");
    localStorage.removeItem("metas");
    localStorage.removeItem("ganhosExtras");
    alert("Todos os dados foram apagados com sucesso.");
    location.reload();
  }
}



// Função para gerar o PDF (com imagem no topo centralizada)
function gerarPDF() {
  const { jsPDF } = window.jspdf;
  const pdf = new jsPDF('p', 'pt', 'a4');
  const pageWidth = pdf.internal.pageSize.getWidth();
  const pageHeight = pdf.internal.pageSize.getHeight();
  const lineHeight = 20;
  const marginX = 40;
  const maxY = pageHeight - 40;

  const usuario = JSON.parse(localStorage.getItem('usuarioLogado') || '{}');

  const despesas = JSON.parse(localStorage.getItem('despesas')) || [];
  const salarios = JSON.parse(localStorage.getItem('salarios')) || [];
  const metas = JSON.parse(localStorage.getItem('metas')) || [];
  const ganhos = JSON.parse(localStorage.getItem('ganhosExtras')) || [];

  const imgBase64 = ''; // Substitua com sua base64 real
  const imgWidth = 100;
  const imgHeight = 50;
  const imgX = (pageWidth - imgWidth) / 2;

  pdf.addImage(imgBase64, 'PNG', imgX, 20, imgWidth, imgHeight);

  // Cabeçalho
  let y = 90;
  pdf.setFontSize(18);
  pdf.setFont(undefined, 'bold');
  pdf.setTextColor(0);
  pdf.text('RELATÓRIO FINANCEIRO', pageWidth / 2, y, { align: 'center' });
  y += 25;

  pdf.setFontSize(12);
  pdf.setFont(undefined, 'normal');
  pdf.text(`Cliente: ${usuario.usuario || 'Não informado'}`, marginX, y);
  pdf.text(`Data: ${new Date().toLocaleDateString('pt-BR')}`, pageWidth - marginX, y, { align: 'right' });
  y += 30;

  // Verifica quebra de página
  function checkPageBreak() {
    if (y > maxY) {
      pdf.addPage();
      y = 40;
    }
  }

  // Imprime seções
  function printSection(title, list, renderRow) {
    pdf.setFontSize(14);
    pdf.setFont(undefined, 'bold');
    pdf.setTextColor(40);
    pdf.text(title, marginX, y);
    y += 10;
    pdf.setDrawColor(180);
    pdf.line(marginX, y, pageWidth - marginX, y);
    y += 10;

    if (!list.length) {
      pdf.setFontSize(11);
      pdf.setFont(undefined, 'normal');
      pdf.setTextColor(120);
      pdf.text('Nenhum dado registrado.', marginX + 10, y);
      y += lineHeight;
      return;
    }

    list.forEach((item, i) => {
      const linha = renderRow(item, i);
      pdf.setFontSize(11);
      pdf.setFont(undefined, 'normal');
      pdf.setTextColor(30);
      pdf.text(linha, marginX + 10, y);
      y += lineHeight;
      checkPageBreak();
    });

    y += 10;
  }

  printSection('Despesas', despesas, (item, i) => {
    return `${i + 1}. ${item.descricao} - R$ ${Number(item.valor).toFixed(2)} | ${item.data} | ${item.categoria}`;
  });

  printSection('Salários', salarios, (item, i) => {
    return `${i + 1}. R$ ${Number(item.valor).toFixed(2)} | ${item.data || ''}`;
  });

  printSection('Ganhos Extras', ganhos, (item, i) => {
    return `${i + 1}. ${item.descricao || 'Sem descrição'} - R$ ${Number(item.valor).toFixed(2)}`;
  });

  printSection('Metas Financeiras', metas, (item, i) => {
    return `${i + 1}. ${item.nome} - R$ ${Number(item.valor).toFixed(2)}`;
  });

  y += 20;
  pdf.setFontSize(10);
  pdf.setTextColor(160);
  pdf.text('Relatório gerado automaticamente via Art Financer', marginX, y);

  pdf.save('relatorio_financeiro.pdf');
}



// Perfil
const btnPerfil = document.getElementById('btn-perfil');
const modalPerfil = document.getElementById('modal-perfil');
const btnFechar = document.getElementById('btn-fechar');
const btnEditar = document.getElementById('btn-editar');
const btnSalvar = document.getElementById('btn-salvar');

const perfilDados = document.getElementById('perfil-dados');
const perfilUsuarioSpan = document.getElementById('perfil-usuario');
const perfilEmailSpan = document.getElementById('perfil-email');
const perfilIdadeSpan = document.getElementById('perfil-idade');

const perfilForm = document.getElementById('perfil-form');
const inputUsuario = document.getElementById('input-usuario');
const inputEmail = document.getElementById('input-email');
const inputIdade = document.getElementById('input-idade');

// NOVA função para obter o usuário logado como objeto
function getLoggedUser() {
  return JSON.parse(localStorage.getItem('usuarioLogado') || '{}');
}

// Atualiza os dados no array de usuários e no usuarioLogado
function updateUserData(usuarioOriginal, novosDados) {
  let usuarios = JSON.parse(localStorage.getItem('usuarios') || '[]');
  const index = usuarios.findIndex(u => u.usuario === usuarioOriginal.usuario);
  if (index === -1) return false;

  // Atualiza os dados no array principal
  usuarios[index] = { ...usuarios[index], ...novosDados };
  localStorage.setItem('usuarios', JSON.stringify(usuarios));

  // Atualiza o usuário logado também
  localStorage.setItem('usuarioLogado', JSON.stringify(usuarios[index]));

  return true;
}

function carregarPerfil() {
  const dados = getLoggedUser();

  if (!dados.usuario) {
    alert('Nenhum usuário logado.');
    return;
  }

  perfilUsuarioSpan.textContent = dados.usuario;
  perfilEmailSpan.textContent = dados.email;
  perfilIdadeSpan.textContent = dados.idade;

  inputUsuario.value = dados.usuario;
  inputEmail.value = dados.email;
  inputIdade.value = dados.idade;
}

function setInputsDisabled(state) {
  inputUsuario.disabled = state;
  inputEmail.disabled = state;
  inputIdade.disabled = state;
}

// Abrir modal e carregar dados
btnPerfil.addEventListener('click', () => {
  carregarPerfil();
  modalPerfil.classList.remove('hidden');
  modalPerfil.setAttribute('aria-hidden', 'false');
  perfilForm.classList.add('hidden');
  perfilDados.classList.remove('hidden');
  btnEditar.classList.remove('hidden');
  btnSalvar.classList.add('hidden');
  setInputsDisabled(true);
});

// Fechar modal
btnFechar.addEventListener('click', () => {
  modalPerfil.classList.add('hidden');
  modalPerfil.setAttribute('aria-hidden', 'true');
  setInputsDisabled(true);
});

// Botão Editar
btnEditar.addEventListener('click', () => {
  perfilDados.classList.add('hidden');
  perfilForm.classList.remove('hidden');
  btnEditar.classList.add('hidden');
  btnSalvar.classList.remove('hidden');
  setInputsDisabled(false);
});

// Botão Salvar
btnSalvar.addEventListener('click', () => {
  if (!inputUsuario.value.trim() || !inputEmail.value.trim() || !inputIdade.value.trim()) {
    alert('Por favor, preencha todos os campos.');
    return;
  }

  const usuarioAtual = getLoggedUser();

  const novosDados = {
    usuario: inputUsuario.value.trim(),
    email: inputEmail.value.trim(),
    idade: parseInt(inputIdade.value)
  };

  const sucesso = updateUserData(usuarioAtual, novosDados);
  if (!sucesso) {
    alert('Erro ao salvar os dados.');
    return;
  }

  alert('Perfil atualizado com sucesso!');
  carregarPerfil();

  perfilForm.classList.add('hidden');
  perfilDados.classList.remove('hidden');
  btnEditar.classList.remove('hidden');
  btnSalvar.classList.add('hidden');
  setInputsDisabled(true);
});

// Fechar modal clicando fora da caixa (opcional)
modalPerfil.addEventListener('click', (e) => {
  if (e.target === modalPerfil) {
    modalPerfil.classList.add('hidden');
    modalPerfil.setAttribute('aria-hidden', 'true');
    setInputsDisabled(true);
  }
});
